import React from "react";
import Button from '@material-ui/core/Button';

const Home = () => {
  return (
    <>
      <div className="container-fluid ">
        <div className=" row ">
          <div className="col-10 mx-auto">
             <div className='row'>
             <div className='col-lg-6 mx-auto order-lg-1 order-2'>
                <h1>Grow your business with <strong>Muhammad Jawad</strong></h1>
                <div>
                 <Button variant="outlined" color="primary" className="">Getting Started</Button>
                </div>
             </div>

             </div>
          </div>
        </div>
      </div>
    </>
  )
}
export default Home;
